"BEGIN {FS=" "}
/^Total reads processed:/ { n = $NF }
END {
    gsub(/,/,"",n)
    printf "%12s    %14s\n", "Raw", n
}"

"BEGIN { 
    FS=" "
    print "Usable Fragments"
    print
    printf "%12s    %14s    %7s\n", "DATASET", "# READS", "%"
}
NR==1 { print }
NR==2 { 
    total = $2 
    printf "%26s    %7s\n", $0, "100.0%"}
NR>2 {
    temp = $2 / total * 100
    printf "%26s      %-3.1f%\n", $0, temp
}"

"BEGIN {
    print ""
    print "Library complexity"
    print
    mt=1;m0=1;m1=1;m2=1
}
($1==1) { m1=m1+1 }
($1==2) { m2=m2+1 }
{m0=m0+1}
{mt=mt+$1}
END {
    printf "%5s    %.3f\n", "NRF", m0/mt
    printf "%5s    %.3f\n", "PBC1", m1/m0
    printf "%5s    %.3f\n", "PBC2", m1/m2
}"

"$ awk '
        (NR==FNR){
            count[$1]=$2; 
            next
        } 
        {
            for(k=1;k<=count[$1];k++){
                print $1"."k"\t"$2
            }
        }' counts"

